import{_ as e,c as a,o,N as l}from"./chunks/framework.6510d215.js";const u=JSON.parse('{"title":"复盘总结 | 2021.07.01-2021.07.31","description":"","frontmatter":{"title":"复盘总结 | 2021.07.01-2021.07.31","author":"周一","date":"2021-07-10","categories":["碎碎念个人成长"],"tags":["复盘总结"],"sidebar":"auto"},"headers":[{"level":1,"title":"2021 年 7 月复盘总结","slug":"_2021-年-7-月复盘总结","link":"#_2021-年-7-月复盘总结","children":[]},{"level":1,"title":"🖼️ 序言","slug":"🖼️-序言","link":"#🖼️-序言","children":[]},{"level":1,"title":"📈 学习时间统计","slug":"📈-学习时间统计","link":"#📈-学习时间统计","children":[]},{"level":1,"title":"📝blog 输出","slug":"📝blog-输出","link":"#📝blog-输出","children":[{"level":2,"title":"新技术","slug":"新技术","link":"#新技术","children":[]},{"level":2,"title":"数据结构与算法","slug":"数据结构与算法","link":"#数据结构与算法","children":[]},{"level":2,"title":"一些零碎知识点","slug":"一些零碎知识点","link":"#一些零碎知识点","children":[]}]},{"level":1,"title":"⏰ 总结","slug":"⏰-总结","link":"#⏰-总结","children":[]}],"relativePath":"column/Growing/ReviewSummary/001.md","lastUpdated":1685151998000}'),t={name:"column/Growing/ReviewSummary/001.md"},c=l('<h1 id="_2021-年-7-月复盘总结" tabindex="-1">2021 年 7 月复盘总结 <a class="header-anchor" href="#_2021-年-7-月复盘总结" aria-label="Permalink to &quot;2021 年 7 月复盘总结&quot;">​</a></h1><h1 id="🖼️-序言" tabindex="-1">🖼️ 序言 <a class="header-anchor" href="#🖼️-序言" aria-label="Permalink to &quot;🖼️ 序言&quot;">​</a></h1><p>搁置了很久的七月复盘在今天才进行了归纳整理。</p><p>在上个月中，有 <code>1/3</code> 的时间在准备期末，有 <code>2/3</code> 的时间在给自己充电。</p><h1 id="📈-学习时间统计" tabindex="-1">📈 学习时间统计 <a class="header-anchor" href="#📈-学习时间统计" aria-label="Permalink to &quot;📈 学习时间统计&quot;">​</a></h1><p>累计统计天数： <code>22</code> 天</p><p>累计专注时间： <code>225</code> h <code>15</code> min</p><p>日均学习时间： <code>10</code> h <code>15</code> min</p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270858290.png" alt="饼图"></p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270858795.png" alt="学习时长统计"></p><h1 id="📝blog-输出" tabindex="-1">📝blog 输出 <a class="header-anchor" href="#📝blog-输出" aria-label="Permalink to &quot;📝blog 输出&quot;">​</a></h1><h2 id="新技术" tabindex="-1">新技术 <a class="header-anchor" href="#新技术" aria-label="Permalink to &quot;新技术&quot;">​</a></h2><p>完成 <code>webpack</code> 的入门学习，累计花费时间 <code>65h15min</code> 。</p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270858974.png" alt="webpack学习"></p><p>在学习完 <code>webpack</code> 的入门内容之后，对自己的新期待是，学习大框架的思想，比如 <code>create-react-app</code> 和 <code>vue-cli</code> 。</p><h2 id="数据结构与算法" tabindex="-1">数据结构与算法 <a class="header-anchor" href="#数据结构与算法" aria-label="Permalink to &quot;数据结构与算法&quot;">​</a></h2><p>继五月份过后，重新把之前做过的题目进行归纳总结，进一步复习。</p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270858343.png" alt="数据结构与算法"></p><p>对于算法来说，总结下来就是不要提前先去害怕它，而要每天循序渐进地进行题目分配并刷题，算法思想将会慢慢地一步步形成。这也算是相对比较大的一个难关，没有其他捷径可走，<strong>多刷题</strong>，<strong>多练习</strong>，<strong>多总结</strong>，<strong>多归纳</strong>，方为上策。</p><h2 id="一些零碎知识点" tabindex="-1">一些零碎知识点 <a class="header-anchor" href="#一些零碎知识点" aria-label="Permalink to &quot;一些零碎知识点&quot;">​</a></h2><p>之前学习基础知识的时候，对一些知识点的认识只停留在表面，没有很深入的去了解。于是在这个月也赶忙一起整理了，把之前的困惑都尽快地清除。</p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270859824.png" alt="零散博客整理"></p><h1 id="⏰-总结" tabindex="-1">⏰ 总结 <a class="header-anchor" href="#⏰-总结" aria-label="Permalink to &quot;⏰ 总结&quot;">​</a></h1><p>可以说在 7 月份中，每一天的时间都是自己的，也没有被太多外界的事物所干扰。但是呢，可能正因为这样，才对自己的学习时间有所放宽，间接地摸鱼时间似乎又多了许多。做复盘的同时也想要给自己敲一个警钟，时间对于每个人来说都是平等的，希望能够正视到自己所存在的问题，尽快地调整好作息规范~</p>',24),i=[c];function r(n,d,s,h,p,m){return o(),a("div",null,i)}const b=e(t,[["render",r]]);export{u as __pageData,b as default};
